const listCustomers = `-- name: ListCustomers :many
SELECT
"Customer".id,
"Customer".book_id,
"Customer".category,
"Customer".name,
"Customer".corporation,
"Customer".address,
"Customer".memo,
"Customer".pic,
"Customer".leader,
"Customer".updated_at,
"Customer".created_at,
pic."id" as pic_id,
pic."name" as pic_name,
pic."sex" as pic_sex,
leader."id" as leader_id,
leader."name" as leader_name,
leader."sex" as leader_sex
FROM "Customer"
JOIN "Staff" AS pic ON "Customer".pic = "Staff".id
JOIN "Staff" AS leader ON "Customer".leader = "Staff".id
WHERE book_id = $1
ORDER BY "Customer"."updated_at" DESC
LIMIT $2
OFFSET $3
`

type ListCustomersParams struct {
	BookID uuid.UUID `json:"book_id"`
	Limit  int32     `json:"limit"`
	Offset int32     `json:"offset"`
}

type ListCustomersRow struct {
	ID          uuid.UUID `json:"id"`
	BookID      uuid.UUID `json:"book_id"`
	Category    string    `json:"category"`
	Name        string    `json:"name"`
	Corporation string    `json:"corporation"`
	Address     string    `json:"address"`
	Memo        string    `json:"memo"`
	Pic         uuid.UUID `json:"pic"`
	Leader      uuid.UUID `json:"leader"`
	UpdatedAt   time.Time `json:"updated_at"`
	CreatedAt   time.Time `json:"created_at"`
	PicID       uuid.UUID `json:"pic_id"`
	PicName     string    `json:"pic_name"`
	PicSex      string    `json:"pic_sex"`
	LeaderID    uuid.UUID `json:"leader_id"`
	LeaderName  string    `json:"leader_name"`
	LeaderSex   string    `json:"leader_sex"`
}

func (q *Queries) ListCustomers(ctx context.Context, arg ListCustomersParams) ([]ListCustomersRow, error) {
	rows, err := q.db.Query(ctx, listCustomers, arg.BookID, arg.Limit, arg.Offset)
	if err != nil {
		return nil, err
	}
	defer rows.Close()
	items := []ListCustomersRow{}
	for rows.Next() {
		var i ListCustomersRow
		if err := rows.Scan(
			&i.ID,
			&i.BookID,
			&i.Category,
			&i.Name,
			&i.Corporation,
			&i.Address,
			&i.Memo,
			&i.Pic,
			&i.Leader,
			&i.UpdatedAt,
			&i.CreatedAt,
			&i.PicID,
			&i.PicName,
			&i.PicSex,
			&i.LeaderID,
			&i.LeaderName,
			&i.LeaderSex,
		); err != nil {
			return nil, err
		}
		items = append(items, i)
	}
	if err := rows.Err(); err != nil {
		return nil, err
	}
	return items, nil
}

const updateCustomer = `-- name: UpdateCustomer :one
UPDATE "Customer"
SET
  category = COALESCE($1, category),
  name = COALESCE($2, name),
  corporation = COALESCE($3, corporation),
  address = COALESCE($4, address),
  memo = COALESCE($5, memo)
WHERE id = $6
RETURNING id, book_id, category, name, corporation, address, memo, pic, leader, updated_at, created_at
`

type UpdateCustomerParams struct {
	Category    pgtype.Text `json:"category"`
	Name        pgtype.Text `json:"name"`
	Corporation pgtype.Text `json:"corporation"`
	Address     pgtype.Text `json:"address"`
	Memo        pgtype.Text `json:"memo"`
	ID          uuid.UUID   `json:"id"`
}

func (q *Queries) UpdateCustomer(ctx context.Context, arg UpdateCustomerParams) (Customer, error) {
	row := q.db.QueryRow(ctx, updateCustomer,
		arg.Category,
		arg.Name,
		arg.Corporation,
		arg.Address,
		arg.Memo,
		arg.ID,
	)
	var i Customer
	err := row.Scan(
		&i.ID,
		&i.BookID,
		&i.Category,
		&i.Name,
		&i.Corporation,
		&i.Address,
		&i.Memo,
		&i.Pic,
		&i.Leader,
		&i.UpdatedAt,
		&i.CreatedAt,
	)
	return i, err
}
